private void readObject(ObjectInputStream s) throws ClassNotFoundException, IOException {
    s.defaultReadObject();
    // could use lazy initialization instead
    fSelection = new Vector();
    if (fDrawing != null)
        fDrawing.addDrawingChangeListener(this);
}
